    false,nt"url": null,nt"notes": "Watershed Sciences, Inc. (WSI) collected
    Light Detection and Ranging (LiDAR) data for the Chehalis River Watershed study
    area on January 28th, February 2nd-7th, March 4th-9th, March 21st-23rd, and April
    7th, 2012. Acquisition days were not consecutive due to weather. Data was collected
    for the Puget Sound LiDAR Consortium in partnership with the Federal Emergency Management
    Agency Region X (FEMA), Washington Department of Natural Resources, and Lewis County.
    The requested area of 224,713 acres for the Chehalis River Watershed was expanded
    to include a 100m buffer to ensure complete coverage and adequate point densities
    around survey area boundaries resulting in a total of 234,556 acres of delivered
    LiDAR data. The LiDAR survey utilized an Optech Orion-C and a Leica ALS60 sensor
    in a Cessna Caravan 208B. Please see "Project Report" below for specific information
    regarding the airborne survey and ground survey. This Lidar survey acheived a nominal
    point spacing of 10.94 points per square meter.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
